'use strict';
let MessageType = require('./MessageType.js');
class NamedTriggerMessage {
    name;
    static create(name) {
        let result;
        result = new NamedTriggerMessage();
        result.name = name;
        return result;
    }
    getName() {
        return this.name;
    }
    getType() {
        return MessageType.NamedTrigger;
    }
}
module.exports = NamedTriggerMessage
